import {Component} from 'react';

class UserList extends Component{
    constructor() {
        parent()
        this.state = {
            onlineUsers:0
        };
    }
    render() {
        <div>
            {this.state.onlineUsers}
            <button className="btn btn-primary" onClick={this.setState(this.state.onlineUsers++)}></button>
        </div>
    }
}

export default UserList;
